BEGIN TRANSACTION;
CREATE TABLE cars(CARID INT(99),SPAWNX INT(99),SPAWNY INT(99), SPAWNZ INT(99),ROTX INT(99), ROTY INT(99),ROTZ INT(99),R INT(256),G INT(256),B INT(256),OWNER VARCHAR(99),CARKEY INT(256),PRICE INT(99) );
CREATE TABLE accounts(username VARCHAR(30),password VARCHAR(256),skin INT(99),money INT(99),team VARCHAR(30),x INT(256),y INT(256),z INT(256),inte INT(13),dim INT(30),drift INT(99),d_licence INT(10),b_licence INT(10) );
COMMIT;
